import './App.css';
import {Routes, Route} from "react-router-dom";
import Cont from './Cont';
import Header from './Header';
import Movies from './Movies';

function App() {
  return (
    <>
      <Header/>
      <Routes>
          <Route path='/' element={<Cont/>}></Route>
          <Route path='Movies' element={<Movies name="shoaib"/>}></Route>
      </Routes>
    </>

  );
}

export default App;
